
Bacterial DNA was extracted from faecal samples and subjected to unbiased, whole-genome shotgun (WGS) sequencing using the Illumina GAIIx and HiSeq2000. In summary, 145 samples were sequenced in stage I and 378.4 Gb of paired-end (PE) sequence data were generated; 200 samples were sequenced in stage II and 830.8 Gb of PE sequence data were generated, as well as 23 additional samples for a validation study on gut-microbiota-based T2D classification. By combining MetaHIT data and our sequence data in stage I we constructed an updated human gut microbial gene catalogue, which contained 4.3 million genes suitable for studies on Chinese individuals. In this updated gene catalogue, 21.3%, 47.1% and 60.9% of genes could be assigned to known genera, KEGG and eggNOG database respectively. Taking this gene catalogue as a reference, we identified gene, KO and OG markers, respectively, which seemed to be strongly associated with T2D in our two-stage case-control study, and 47 Metagenomic Linkage Groups (MLGs). These MLGs were further assembled into different contig sets, which could provide useful genetic, functional, and taxonomic information for the relevant bacterium.
